contracts/ComplianceManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title ComplianceManager
 * @dev Smart contract for managing compliance with data protection regulations
 * 
 * Features:
 * - GDPR compliance tracking
 * - DPDP (India) compliance
 * - Data residency requirements
 * - Automated compliance reporting
 * - Regulatory audit trails
 * - Consent lifecycle management
 */
contract ComplianceManager is Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;

    // Structs
    struct ComplianceRecord {
        address userAddress;
        string regulation;
        string complianceType;
        uint256 timestamp;
        bool isCompliant;
        string details;
        string region;
        uint256 expiryTime;
    }

    struct DataResidency {
        string dataHash;
        string region;
        string jurisdiction;
        uint256 timestamp;
        bool isCompliant;
        string complianceDetails;
    }

    struct RegulatoryReport {
        string reportId;
        string regulation;
        string reportType;
        uint256 timestamp;
        string reportHash;
        bool isSubmitted;
        address submittedBy;
    }

    struct ConsentLifecycle {
        address userAddress;
        string dataHash;
        uint256 consentGrantedAt;
        uint256 consentRevokedAt;
        uint256 dataRetentionExpiry;
        bool isRetentionCompliant;
        string retentionPolicy;
    }

    // State Variables
    Counters.Counter private _complianceIds;
    Counters.Counter private _residencyIds;
    Counters.Counter private _reportIds;
    Counters.Counter private _lifecycleIds;

    // Mappings
    mapping(uint256 => ComplianceRecord) public complianceRecords;
    mapping(uint256 => DataResidency) public dataResidency;
    mapping(uint256 => RegulatoryReport) public regulatoryReports;
    mapping(uint256 => ConsentLifecycle) public consentLifecycles;
    
    // User compliance tracking
    mapping(address => uint256[]) public userComplianceRecords;
    mapping(address => mapping(string => bool)) public userRegulationCompliance;
    
    // Data residency tracking
    mapping(string => uint256) public hashToResidencyId;
    
    // Report tracking
    mapping(string => uint256) public reportIdToReport;
    mapping(string => uint256[]) public regulationReports;

    // Supported regulations
    mapping(string => bool) public supportedRegulations;
    
    // Data retention policies
    mapping(string => uint256) public retentionPolicies;

    // Events
    event ComplianceRecorded(
        uint256 indexed recordId,
        address indexed userAddress,
        string regulation,
        string complianceType,
        bool isCompliant,
        string region,
        uint256 timestamp
    );

    event DataResidencyRecorded(
        uint256 indexed residencyId,
        string dataHash,
        string region,
        string jurisdiction,
        bool isCompliant,
        uint256 timestamp
    );

    event RegulatoryReportGenerated(
        uint256 indexed reportId,
        string reportIdString,
        string regulation,
        string reportType,
        string reportHash,
        address indexed submittedBy,
        uint256 timestamp
    );

    event ConsentLifecycleRecorded(
        uint256 indexed lifecycleId,
        address indexed userAddress,
        string dataHash,
        uint256 consentGrantedAt,
        uint256 dataRetentionExpiry,
        string retentionPolicy,
        uint256 timestamp
    );

    event RetentionPolicyUpdated(
        string dataType,
        uint256 newRetentionPeriod,
        address indexed updatedBy,
        uint256 timestamp
    );

    event RegulationSupported(
        string regulation,
        bool isSupported,
        address indexed updatedBy,
        uint256 timestamp
    );

    // Modifiers
    modifier onlySupportedRegulation(string memory regulation) {
        require(supportedRegulations[regulation], "Regulation not supported");
        _;
    }

    modifier onlyValidComplianceRecord(uint256 recordId) {
        require(recordId > 0 && recordId <= _complianceIds.current(), "Invalid compliance record ID");
        _;
    }

    // Constructor
    constructor() {
        _complianceIds.increment();
        _residencyIds.increment();
        _reportIds.increment();
        _lifecycleIds.increment();
        
        // Initialize supported regulations
        supportedRegulations["GDPR"] = true;
        supportedRegulations["DPDP"] = true;
        supportedRegulations["CCPA"] = true;
        supportedRegulations["LGPD"] = true;
        
        // Initialize retention policies (in seconds)
        retentionPolicies["personal_data"] = 365 days;
        retentionPolicies["financial_data"] = 7 * 365 days;
        retentionPolicies["transaction_data"] = 5 * 365 days;
        retentionPolicies["consent_data"] = 10 * 365 days;
    }

    /**
     * @dev Record compliance for a user
     * @param userAddress Address of the user
     * @param regulation Regulation being complied with
     * @param complianceType Type of compliance
     * @param isCompliant Whether the user is compliant
     * @param details Details of compliance
     * @param region Geographic region
     * @param durationInSeconds How long this compliance record is valid
     */
    function recordCompliance(
        address userAddress,
        string memory regulation,
        string memory complianceType,
        bool isCompliant,
        string memory details,
        string memory region,
        uint256 durationInSeconds
    ) external onlyOwner onlySupportedRegulation(regulation) nonReentrant {
        require(userAddress != address(0), "Invalid user address");
        require(bytes(complianceType).length > 0, "Compliance type cannot be empty");
        require(durationInSeconds > 0, "Duration must be positive");

        uint256 recordId = _complianceIds.current();
        
        complianceRecords[recordId] = ComplianceRecord({
            userAddress: userAddress,
            regulation: regulation,
            complianceType: complianceType,
            timestamp: block.timestamp,
            isCompliant: isCompliant,
            details: details,
            region: region,
            expiryTime: block.timestamp + durationInSeconds
        });

        userComplianceRecords[userAddress].push(recordId);
        userRegulationCompliance[userAddress][regulation] = isCompliant;

        _complianceIds.increment();

        emit ComplianceRecorded(
            recordId,
            userAddress,
            regulation,
            complianceType,
            isCompliant,
            region,
            block.timestamp
        );
    }

    /**
     * @dev Record data residency information
     * @param dataHash Hash of the data
     * @param region Geographic region where data is stored
     * @param jurisdiction Legal jurisdiction
     * @param isCompliant Whether residency requirements are met
     * @param complianceDetails Details of compliance
     */
    function recordDataResidency(
        string memory dataHash,
        string memory region,
        string memory jurisdiction,
        bool isCompliant,
        string memory complianceDetails
    ) external onlyOwner nonReentrant {
        require(bytes(dataHash).length > 0, "Data hash cannot be empty");
        require(bytes(region).length > 0, "Region cannot be empty");

        uint256 residencyId = _residencyIds.current();
        
        dataResidency[residencyId] = DataResidency({
            dataHash: dataHash,
            region: region,
            jurisdiction: jurisdiction,
            timestamp: block.timestamp,
            isCompliant: isCompliant,
            complianceDetails: complianceDetails
        });

        hashToResidencyId[dataHash] = residencyId;
        _residencyIds.increment();

        emit DataResidencyRecorded(
            residencyId,
            dataHash,
            region,
            jurisdiction,
            isCompliant,
            block.timestamp
        );
    }

    /**
     * @dev Generate regulatory report
     * @param reportId Unique identifier for the report
     * @param regulation Regulation the report is for
     * @param reportType Type of report
     * @param reportHash Hash of the report content
     */
    function generateRegulatoryReport(
        string memory reportId,
        string memory regulation,
        string memory reportType,
        string memory reportHash
    ) external onlyOwner onlySupportedRegulation(regulation) nonReentrant {
        require(bytes(reportId).length > 0, "Report ID cannot be empty");
        require(bytes(reportType).length > 0, "Report type cannot be empty");
        require(bytes(reportHash).length > 0, "Report hash cannot be empty");
        require(reportIdToReport[reportId] == 0, "Report ID already exists");

        uint256 reportIndex = _reportIds.current();
        
        regulatoryReports[reportIndex] = RegulatoryReport({
            reportId: reportId,
            regulation: regulation,
            reportType: reportType,
            timestamp: block.timestamp,
            reportHash: reportHash,
            isSubmitted: true,
            submittedBy: msg.sender
        });

        reportIdToReport[reportId] = reportIndex;
        regulationReports[regulation].push(reportIndex);
        _reportIds.increment();

        emit RegulatoryReportGenerated(
            reportIndex,
            reportId,
            regulation,
            reportType,
            reportHash,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Record consent lifecycle
     * @param userAddress Address of the user
     * @param dataHash Hash of the data
     * @param consentGrantedAt When consent was granted
     * @param dataType Type of data for retention policy
     */
    function recordConsentLifecycle(
        address userAddress,
        string memory dataHash,
        uint256 consentGrantedAt,
        string memory dataType
    ) external onlyOwner nonReentrant {
        require(userAddress != address(0), "Invalid user address");
        require(bytes(dataHash).length > 0, "Data hash cannot be empty");
        require(consentGrantedAt > 0, "Invalid consent timestamp");

        uint256 lifecycleId = _lifecycleIds.current();
        uint256 retentionPeriod = retentionPolicies[dataType];
        require(retentionPeriod > 0, "No retention policy for data type");
        
        consentLifecycles[lifecycleId] = ConsentLifecycle({
            userAddress: userAddress,
            dataHash: dataHash,
            consentGrantedAt: consentGrantedAt,
            consentRevokedAt: 0,
            dataRetentionExpiry: consentGrantedAt + retentionPeriod,
            isRetentionCompliant: true,
            retentionPolicy: dataType
        });

        _lifecycleIds.increment();

        emit ConsentLifecycleRecorded(
            lifecycleId,
            userAddress,
            dataHash,
            consentGrantedAt,
            consentGrantedAt + retentionPeriod,
            dataType,
            block.timestamp
        );
    }

    /**
     * @dev Update retention policy
     * @param dataType Type of data
     * @param retentionPeriodInSeconds New retention period
     */
    function updateRetentionPolicy(
        string memory dataType,
        uint256 retentionPeriodInSeconds
    ) external onlyOwner {
        require(bytes(dataType).length > 0, "Data type cannot be empty");
        require(retentionPeriodInSeconds > 0, "Retention period must be positive");
        
        retentionPolicies[dataType] = retentionPeriodInSeconds;
        
        emit RetentionPolicyUpdated(
            dataType,
            retentionPeriodInSeconds,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Add or remove supported regulation
     * @param regulation Regulation name
     * @param isSupported Whether to support this regulation
     */
    function setRegulationSupport(
        string memory regulation,
        bool isSupported
    ) external onlyOwner {
        require(bytes(regulation).length > 0, "Regulation cannot be empty");
        
        supportedRegulations[regulation] = isSupported;
        
        emit RegulationSupported(
            regulation,
            isSupported,
            msg.sender,
            block.timestamp
        );
    }

    // View Functions

    /**
     * @dev Get compliance record
     * @param recordId ID of the compliance record
     */
    function getComplianceRecord(uint256 recordId) external view onlyValidComplianceRecord(recordId) returns (ComplianceRecord memory) {
        return complianceRecords[recordId];
    }

    /**
     * @dev Get user's compliance records
     * @param userAddress Address of the user
     */
    function getUserComplianceRecords(address userAddress) external view returns (uint256[] memory) {
        return userComplianceRecords[userAddress];
    }

    /**
     * @dev Check if user is compliant with a regulation
     * @param userAddress Address of the user
     * @param regulation Regulation to check
     */
    function isUserCompliant(address userAddress, string memory regulation) external view returns (bool) {
        return userRegulationCompliance[userAddress][regulation];
    }

    /**
     * @dev Get data residency information
     * @param dataHash Hash of the data
     */
    function getDataResidency(string memory dataHash) external view returns (DataResidency memory) {
        uint256 residencyId = hashToResidencyId[dataHash];
        require(residencyId > 0, "No residency record found");
        return dataResidency[residencyId];
    }

    /**
     * @dev Get regulatory report
     * @param reportId Report ID
     */
    function getRegulatoryReport(string memory reportId) external view returns (RegulatoryReport memory) {
        uint256 reportIndex = reportIdToReport[reportId];
        require(reportIndex > 0, "Report not found");
        return regulatoryReports[reportIndex];
    }

    /**
     * @dev Get reports for a regulation
     * @param regulation Regulation name
     */
    function getRegulationReports(string memory regulation) external view returns (uint256[] memory) {
        return regulationReports[regulation];
    }

    /**
     * @dev Get consent lifecycle
     * @param lifecycleId ID of the lifecycle record
     */
    function getConsentLifecycle(uint256 lifecycleId) external view returns (ConsentLifecycle memory) {
        require(lifecycleId > 0 && lifecycleId < _lifecycleIds.current(), "Invalid lifecycle ID");
        return consentLifecycles[lifecycleId];
    }

    /**
     * @dev Get retention policy for data type
     * @param dataType Type of data
     */
    function getRetentionPolicy(string memory dataType) external view returns (uint256) {
        return retentionPolicies[dataType];
    }

    /**
     * @dev Check if regulation is supported
     * @param regulation Regulation name
     */
    function isRegulationSupported(string memory regulation) external view returns (bool) {
        return supportedRegulations[regulation];
    }

    /**
     * @dev Get contract statistics
     */
    function getContractStats() external view returns (
        uint256 totalComplianceRecords,
        uint256 totalResidencyRecords,
        uint256 totalReports,
        uint256 totalLifecycles
    ) {
        return (
            _complianceIds.current() - 1,
            _residencyIds.current() - 1,
            _reportIds.current() - 1,
            _lifecycleIds.current() - 1
        );
    }
}

contracts/DataTokenization.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title DataTokenization
 * @dev Smart contract for managing data tokenization and encryption keys
 * 
 * Features:
 * - Token generation for sensitive data
 * - Encryption key management
 * - Token-to-data mapping
 * - Secure key storage
 * - Token validation
 */
contract DataTokenization is Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;

    // Structs
    struct TokenizedData {
        string originalDataHash;
        string token;
        string encryptionKeyHash;
        uint256 timestamp;
        address owner;
        bool isActive;
        string dataType;
        uint256 expiryTime;
    }

    struct EncryptionKey {
        string keyHash;
        string algorithm;
        uint256 timestamp;
        bool isActive;
        address createdBy;
    }

    // State Variables
    Counters.Counter private _tokenIds;
    Counters.Counter private _keyIds;

    // Mappings
    mapping(uint256 => TokenizedData) public tokenizedData;
    mapping(uint256 => EncryptionKey) public encryptionKeys;
    mapping(string => uint256) public tokenToDataId;
    mapping(address => uint256[]) public userTokens;
    mapping(string => bool) public usedTokens;
    mapping(string => uint256) public hashToTokenId;

    // Events
    event DataTokenized(
        uint256 indexed tokenId,
        address indexed owner,
        string originalDataHash,
        string token,
        string dataType,
        uint256 timestamp
    );

    event TokenRevoked(
        uint256 indexed tokenId,
        address indexed owner,
        uint256 timestamp
    );

    event EncryptionKeyCreated(
        uint256 indexed keyId,
        string keyHash,
        string algorithm,
        address indexed createdBy,
        uint256 timestamp
    );

    event EncryptionKeyRevoked(
        uint256 indexed keyId,
        address indexed revokedBy,
        uint256 timestamp
    );

    event TokenValidated(
        string token,
        bool isValid,
        uint256 timestamp
    );

    // Modifiers
    modifier onlyTokenOwner(uint256 tokenId) {
        require(tokenId > 0 && tokenId <= _tokenIds.current(), "Invalid token ID");
        require(tokenizedData[tokenId].owner == msg.sender, "Not token owner");
        _;
    }

    modifier onlyValidToken(string memory token) {
        require(usedTokens[token], "Token does not exist");
        _;
    }

    // Constructor
    constructor() {
        _tokenIds.increment();
        _keyIds.increment();
    }

    /**
     * @dev Tokenize sensitive data
     * @param originalDataHash Hash of the original data
     * @param token Generated token for the data
     * @param encryptionKeyHash Hash of the encryption key
     * @param dataType Type of data being tokenized
     * @param durationInSeconds How long the token is valid
     */
    function tokenizeData(
        string memory originalDataHash,
        string memory token,
        string memory encryptionKeyHash,
        string memory dataType,
        uint256 durationInSeconds
    ) external nonReentrant {
        require(bytes(originalDataHash).length > 0, "Data hash cannot be empty");
        require(bytes(token).length > 0, "Token cannot be empty");
        require(bytes(encryptionKeyHash).length > 0, "Encryption key hash cannot be empty");
        require(!usedTokens[token], "Token already exists");
        require(durationInSeconds > 0, "Duration must be positive");

        uint256 tokenId = _tokenIds.current();
        
        tokenizedData[tokenId] = TokenizedData({
            originalDataHash: originalDataHash,
            token: token,
            encryptionKeyHash: encryptionKeyHash,
            timestamp: block.timestamp,
            owner: msg.sender,
            isActive: true,
            dataType: dataType,
            expiryTime: block.timestamp + durationInSeconds
        });

        tokenToDataId[token] = tokenId;
        userTokens[msg.sender].push(tokenId);
        usedTokens[token] = true;
        hashToTokenId[originalDataHash] = tokenId;

        _tokenIds.increment();

        emit DataTokenized(
            tokenId,
            msg.sender,
            originalDataHash,
            token,
            dataType,
            block.timestamp
        );
    }

    /**
     * @dev Revoke a token
     * @param tokenId ID of the token to revoke
     */
    function revokeToken(uint256 tokenId) external onlyTokenOwner(tokenId) {
        TokenizedData storage data = tokenizedData[tokenId];
        require(data.isActive, "Token already revoked");
        
        data.isActive = false;
        usedTokens[data.token] = false;

        emit TokenRevoked(
            tokenId,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Create encryption key
     * @param keyHash Hash of the encryption key
     * @param algorithm Encryption algorithm used
     */
    function createEncryptionKey(
        string memory keyHash,
        string memory algorithm
    ) external onlyOwner {
        require(bytes(keyHash).length > 0, "Key hash cannot be empty");
        require(bytes(algorithm).length > 0, "Algorithm cannot be empty");

        uint256 keyId = _keyIds.current();
        
        encryptionKeys[keyId] = EncryptionKey({
            keyHash: keyHash,
            algorithm: algorithm,
            timestamp: block.timestamp,
            isActive: true,
            createdBy: msg.sender
        });

        _keyIds.increment();

        emit EncryptionKeyCreated(
            keyId,
            keyHash,
            algorithm,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Revoke encryption key
     * @param keyId ID of the key to revoke
     */
    function revokeEncryptionKey(uint256 keyId) external onlyOwner {
        require(keyId > 0 && keyId < _keyIds.current(), "Invalid key ID");
        require(encryptionKeys[keyId].isActive, "Key already revoked");
        
        encryptionKeys[keyId].isActive = false;

        emit EncryptionKeyRevoked(
            keyId,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Validate a token
     * @param token Token to validate
     * @return isValid Whether the token is valid
     * @return tokenId ID of the token if valid
     */
    function validateToken(string memory token) external view returns (bool isValid, uint256 tokenId) {
        if (!usedTokens[token]) {
            return (false, 0);
        }

        tokenId = tokenToDataId[token];
        TokenizedData storage data = tokenizedData[tokenId];
        
        isValid = data.isActive && data.expiryTime > block.timestamp;

        return (isValid, tokenId);
    }

    /**
     * @dev Get tokenized data by token
     * @param token Token to look up
     */
    function getTokenizedDataByToken(string memory token) external view onlyValidToken(token) returns (TokenizedData memory) {
        uint256 tokenId = tokenToDataId[token];
        return tokenizedData[tokenId];
    }

    /**
     * @dev Get tokenized data by original hash
     * @param originalDataHash Hash of the original data
     */
    function getTokenizedDataByHash(string memory originalDataHash) external view returns (TokenizedData memory) {
        uint256 tokenId = hashToTokenId[originalDataHash];
        require(tokenId > 0, "No token found for this hash");
        return tokenizedData[tokenId];
    }

    /**
     * @dev Get user's tokens
     * @param userAddress Address of the user
     */
    function getUserTokens(address userAddress) external view returns (uint256[] memory) {
        return userTokens[userAddress];
    }

    /**
     * @dev Get encryption key details
     * @param keyId ID of the encryption key
     */
    function getEncryptionKey(uint256 keyId) external view returns (EncryptionKey memory) {
        require(keyId > 0 && keyId < _keyIds.current(), "Invalid key ID");
        return encryptionKeys[keyId];
    }

    /**
     * @dev Check if token exists and is active
     * @param token Token to check
     */
    function isTokenActive(string memory token) external view returns (bool) {
        if (!usedTokens[token]) {
            return false;
        }
        
        uint256 tokenId = tokenToDataId[token];
        TokenizedData storage data = tokenizedData[tokenId];
        
        return data.isActive && data.expiryTime > block.timestamp;
    }

    /**
     * @dev Get contract statistics
     */
    function getContractStats() external view returns (
        uint256 totalTokens,
        uint256 totalKeys
    ) {
        return (
            _tokenIds.current() - 1,
            _keyIds.current() - 1
        );
    }

    /**
     * @dev Get active tokens count
     */
    function getActiveTokensCount() external view returns (uint256) {
        uint256 activeCount = 0;
        for (uint256 i = 1; i < _tokenIds.current(); i++) {
            if (tokenizedData[i].isActive && tokenizedData[i].expiryTime > block.timestamp) {
                activeCount++;
            }
        }
        return activeCount;
    }
}

contracts/PrivacyFramework.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title PrivacyFramework
 * @dev AI-Driven Decentralized Data Privacy Framework for Fintech Ecosystems
 * 
 * Features:
 * - Consent Management
 * - Access Control
 * - Audit Trails
 * - Data Sharing Logs
 * - Anomaly Detection Support
 * - Compliance Enforcement
 */
contract PrivacyFramework is Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;

    // Structs
    struct Consent {
        address userAddress;
        string dataHash;
        string useCase;
        uint256 timestamp;
        bool isActive;
        uint256 expiryTime;
        string thirdPartyId;
        string dataType;
        bool isRevoked;
    }

    struct AccessLog {
        address requester;
        string dataHash;
        string purpose;
        uint256 timestamp;
        bool wasGranted;
        string reason;
        string ipAddress;
        string deviceFingerprint;
    }

    struct AnomalyAlert {
        address userAddress;
        string dataHash;
        string anomalyType;
        uint256 timestamp;
        string description;
        bool isResolved;
    }

    // State Variables
    Counters.Counter private _consentIds;
    Counters.Counter private _accessLogIds;
    Counters.Counter private _anomalyIds;

    // Mappings
    mapping(uint256 => Consent) public consents;
    mapping(uint256 => AccessLog) public accessLogs;
    mapping(uint256 => AnomalyAlert) public anomalies;
    
    // User consent tracking
    mapping(address => uint256[]) public userConsents;
    mapping(address => mapping(string => bool)) public userConsentStatus;
    
    // Third party tracking
    mapping(string => bool) public authorizedThirdParties;
    mapping(string => uint256[]) public thirdPartyAccessLogs;

    // Events
    event ConsentGranted(
        uint256 indexed consentId,
        address indexed userAddress,
        string dataHash,
        string useCase,
        uint256 timestamp,
        uint256 expiryTime
    );

    event ConsentRevoked(
        uint256 indexed consentId,
        address indexed userAddress,
        string dataHash,
        uint256 timestamp
    );

    event AccessRequested(
        uint256 indexed logId,
        address indexed requester,
        string dataHash,
        string purpose,
        uint256 timestamp
    );

    event AccessGranted(
        uint256 indexed logId,
        address indexed requester,
        string dataHash,
        uint256 timestamp
    );

    event AccessDenied(
        uint256 indexed logId,
        address indexed requester,
        string dataHash,
        string reason,
        uint256 timestamp
    );

    event AnomalyDetected(
        uint256 indexed anomalyId,
        address indexed userAddress,
        string dataHash,
        string anomalyType,
        string description,
        uint256 timestamp
    );

    event ThirdPartyAuthorized(
        string thirdPartyId,
        address authorizedBy,
        uint256 timestamp
    );

    event ThirdPartyRevoked(
        string thirdPartyId,
        address revokedBy,
        uint256 timestamp
    );

    // Modifiers
    modifier onlyAuthorizedThirdParty(string memory thirdPartyId) {
        require(authorizedThirdParties[thirdPartyId], "Third party not authorized");
        _;
    }

    modifier onlyValidConsent(uint256 consentId) {
        require(consentId > 0 && consentId <= _consentIds.current(), "Invalid consent ID");
        require(consents[consentId].isActive, "Consent not active");
        require(!consents[consentId].isRevoked, "Consent revoked");
        require(consents[consentId].expiryTime > block.timestamp, "Consent expired");
        _;
    }

    // Constructor
    constructor() {
        _consentIds.increment(); // Start from 1
        _accessLogIds.increment();
        _anomalyIds.increment();
    }

    /**
     * @dev Grant consent for data sharing
     * @param dataHash Hash of the data being consented to
     * @param useCase Purpose of data usage
     * @param thirdPartyId Identifier for the third party
     * @param dataType Type of data being shared
     * @param durationInSeconds How long the consent is valid
     */
    function grantConsent(
        string memory dataHash,
        string memory useCase,
        string memory thirdPartyId,
        string memory dataType,
        uint256 durationInSeconds
    ) external nonReentrant {
        require(bytes(dataHash).length > 0, "Data hash cannot be empty");
        require(bytes(useCase).length > 0, "Use case cannot be empty");
        require(durationInSeconds > 0, "Duration must be positive");
        require(authorizedThirdParties[thirdPartyId], "Third party not authorized");

        uint256 consentId = _consentIds.current();
        
        consents[consentId] = Consent({
            userAddress: msg.sender,
            dataHash: dataHash,
            useCase: useCase,
            timestamp: block.timestamp,
            isActive: true,
            expiryTime: block.timestamp + durationInSeconds,
            thirdPartyId: thirdPartyId,
            dataType: dataType,
            isRevoked: false
        });

        userConsents[msg.sender].push(consentId);
        userConsentStatus[msg.sender][dataHash] = true;

        _consentIds.increment();

        emit ConsentGranted(
            consentId,
            msg.sender,
            dataHash,
            useCase,
            block.timestamp,
            block.timestamp + durationInSeconds
        );
    }

    /**
     * @dev Revoke consent
     * @param consentId ID of the consent to revoke
     */
    function revokeConsent(uint256 consentId) external onlyValidConsent(consentId) {
        Consent storage consent = consents[consentId];
        require(consent.userAddress == msg.sender, "Only consent owner can revoke");
        
        consent.isRevoked = true;
        consent.isActive = false;
        userConsentStatus[msg.sender][consent.dataHash] = false;

        emit ConsentRevoked(
            consentId,
            msg.sender,
            consent.dataHash,
            block.timestamp
        );
    }

    /**
     * @dev Request access to data
     * @param dataHash Hash of the data being requested
     * @param purpose Purpose of the access request
     * @param thirdPartyId Identifier for the third party
     * @param ipAddress IP address of the requester
     * @param deviceFingerprint Device fingerprint for security
     */
    function requestAccess(
        string memory dataHash,
        string memory purpose,
        string memory thirdPartyId,
        string memory ipAddress,
        string memory deviceFingerprint
    ) external onlyAuthorizedThirdParty(thirdPartyId) nonReentrant returns (bool) {
        require(bytes(dataHash).length > 0, "Data hash cannot be empty");
        require(bytes(purpose).length > 0, "Purpose cannot be empty");

        uint256 logId = _accessLogIds.current();
        
        // Check if user has active consent for this data
        bool hasConsent = userConsentStatus[msg.sender][dataHash];
        bool accessGranted = false;
        string memory reason = "";

        if (hasConsent) {
            // Find the specific consent
            uint256[] memory userConsentList = userConsents[msg.sender];
            for (uint256 i = 0; i < userConsentList.length; i++) {
                Consent storage consent = consents[userConsentList[i]];
                if (
                    keccak256(bytes(consent.dataHash)) == keccak256(bytes(dataHash)) &&
                    consent.isActive &&
                    !consent.isRevoked &&
                    consent.expiryTime > block.timestamp &&
                    keccak256(bytes(consent.thirdPartyId)) == keccak256(bytes(thirdPartyId))
                ) {
                    accessGranted = true;
                    break;
                }
            }
        }

        if (!accessGranted) {
            reason = "No valid consent found";
        }

        accessLogs[logId] = AccessLog({
            requester: msg.sender,
            dataHash: dataHash,
            purpose: purpose,
            timestamp: block.timestamp,
            wasGranted: accessGranted,
            reason: reason,
            ipAddress: ipAddress,
            deviceFingerprint: deviceFingerprint
        });

        thirdPartyAccessLogs[thirdPartyId].push(logId);
        _accessLogIds.increment();

        emit AccessRequested(
            logId,
            msg.sender,
            dataHash,
            purpose,
            block.timestamp
        );

        if (accessGranted) {
            emit AccessGranted(
                logId,
                msg.sender,
                dataHash,
                block.timestamp
            );
        } else {
            emit AccessDenied(
                logId,
                msg.sender,
                dataHash,
                reason,
                block.timestamp
            );
        }

        return accessGranted;
    }

    /**
     * @dev Report anomaly detected by AI system
     * @param userAddress Address of the user involved
     * @param dataHash Hash of the data involved
     * @param anomalyType Type of anomaly detected
     * @param description Description of the anomaly
     */
    function reportAnomaly(
        address userAddress,
        string memory dataHash,
        string memory anomalyType,
        string memory description
    ) external onlyOwner {
        require(userAddress != address(0), "Invalid user address");
        require(bytes(anomalyType).length > 0, "Anomaly type cannot be empty");

        uint256 anomalyId = _anomalyIds.current();
        
        anomalies[anomalyId] = AnomalyAlert({
            userAddress: userAddress,
            dataHash: dataHash,
            anomalyType: anomalyType,
            timestamp: block.timestamp,
            description: description,
            isResolved: false
        });

        _anomalyIds.increment();

        emit AnomalyDetected(
            anomalyId,
            userAddress,
            dataHash,
            anomalyType,
            description,
            block.timestamp
        );
    }

    /**
     * @dev Resolve an anomaly
     * @param anomalyId ID of the anomaly to resolve
     */
    function resolveAnomaly(uint256 anomalyId) external onlyOwner {
        require(anomalyId > 0 && anomalyId < _anomalyIds.current(), "Invalid anomaly ID");
        require(!anomalies[anomalyId].isResolved, "Anomaly already resolved");
        
        anomalies[anomalyId].isResolved = true;
    }

    /**
     * @dev Authorize a third party
     * @param thirdPartyId Identifier for the third party
     */
    function authorizeThirdParty(string memory thirdPartyId) external onlyOwner {
        require(bytes(thirdPartyId).length > 0, "Third party ID cannot be empty");
        require(!authorizedThirdParties[thirdPartyId], "Third party already authorized");
        
        authorizedThirdParties[thirdPartyId] = true;
        
        emit ThirdPartyAuthorized(
            thirdPartyId,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Revoke third party authorization
     * @param thirdPartyId Identifier for the third party
     */
    function revokeThirdParty(string memory thirdPartyId) external onlyOwner {
        require(authorizedThirdParties[thirdPartyId], "Third party not authorized");
        
        authorizedThirdParties[thirdPartyId] = false;
        
        emit ThirdPartyRevoked(
            thirdPartyId,
            msg.sender,
            block.timestamp
        );
    }

    // View Functions

    /**
     * @dev Get consent details
     * @param consentId ID of the consent
     */
    function getConsent(uint256 consentId) external view returns (Consent memory) {
        require(consentId > 0 && consentId < _consentIds.current(), "Invalid consent ID");
        return consents[consentId];
    }

    /**
     * @dev Get user's consents
     * @param userAddress Address of the user
     */
    function getUserConsents(address userAddress) external view returns (uint256[] memory) {
        return userConsents[userAddress];
    }

    /**
     * @dev Get access log details
     * @param logId ID of the access log
     */
    function getAccessLog(uint256 logId) external view returns (AccessLog memory) {
        require(logId > 0 && logId < _accessLogIds.current(), "Invalid log ID");
        return accessLogs[logId];
    }

    /**
     * @dev Get third party access logs
     * @param thirdPartyId Identifier for the third party
     */
    function getThirdPartyAccessLogs(string memory thirdPartyId) external view returns (uint256[] memory) {
        return thirdPartyAccessLogs[thirdPartyId];
    }

    /**
     * @dev Get anomaly details
     * @param anomalyId ID of the anomaly
     */
    function getAnomaly(uint256 anomalyId) external view returns (AnomalyAlert memory) {
        require(anomalyId > 0 && anomalyId < _anomalyIds.current(), "Invalid anomaly ID");
        return anomalies[anomalyId];
    }

    /**
     * @dev Check if third party is authorized
     * @param thirdPartyId Identifier for the third party
     */
    function isThirdPartyAuthorized(string memory thirdPartyId) external view returns (bool) {
        return authorizedThirdParties[thirdPartyId];
    }

    /**
     * @dev Get contract statistics
     */
    function getContractStats() external view returns (
        uint256 totalConsents,
        uint256 totalAccessLogs,
        uint256 totalAnomalies
    ) {
        return (
            _consentIds.current() - 1,
            _accessLogIds.current() - 1,
            _anomalyIds.current() - 1
        );
    }
}

